import React from 'react';
import PropTypes from 'prop-types';
import GravityForm from 'react-gravity-form';
import { 
  Button, 
  Box, 
  FormLabel as Label,
  Input,
  Textarea,
  Checkbox,
  Radiogroup,
  GFWrapper,
  FileWrapper,
  Consent,
} from '../styles';
import config from '../../theme.config';

const GravityForms = ({ formID, title, populatedFields, onChange }) => (
  <GravityForm
    backendUrl={`${config.wordpress.url.backend}/wp-json/v1/gravityforms`}
    formID={formID}
    title={title}
    onChange={onChange}
    populatedFields={populatedFields}
    styledComponents={{
      Label,
      Input,
      Textarea,
      Checkbox,
      Radiogroup,
      GFWrapper,
      FileWrapper,
      Consent,
    }}
  />
);

GravityForms.defaultProps = {
  title: false,
};

export default GravityForms;
